import React from "react"
import Button from "./tryEx"
import { GameBoard } from "./GameBoard";


const game_board = new GameBoard()
const board = game_board.board
const piece = board[1][1]


function Trr(props) {
    return (
        <div>
            <tr>
                <Button handlePiece = {props.handlePiece} piece = {piece}/>
            </tr>
        </div>
    )

}

export default Trr
